import React from "react";
import { BrowserRouter, Route, Routes } from 'react-router-dom'
import Home from "./components/home";
const Rotas = () => {
    return (
        <BrowserRouter>
            <Routes>
            <Route exact index path='/' element={<Home />} />
              

            </Routes>
        </BrowserRouter >
    )

}
export default Rotas
